import ReactDOM from "react-dom";

function CalculadoraPro(){
  let [element,setElement] = useState(0)

  return(
    <div>
      <h1>Calculadora</h1>
      <p>Palabra a mostrar: {element}</p>
      <input type="button" value={1} name="element" onClick={(e)=>setElement(e.element.target)}/>
    </div>
  )
}
const rootElement = document.getElementById("root");
ReactDOM.render(<CalculadoraPro/>, rootElement);
